import React, { Component } from 'react';
import './App.css';
import Game from './GameOfLife';

class App extends Component {

    render() {

        return (
            <div className="App">
                <h1>Le Jeu de la Vie selon </h1>
                <p>Pour retrouver le principe du Jeu de la Vie de Conway</p>

                <Game />
            </div>
        );
    }
}

export default App;
